import textbookImage from './images/textbookclipart.png';
import './App.css';
import About from './About.js';



function App() {
  return (
    <div class = "App">
      <div id = "logo">
    <h1 id = "header">book exchange</h1>
    <img id = "clipart" src = {textbookImage} />
    </div>
    <h2 id = "subheader"><i>a community of resources, at 
    your fingertips </i></h2>


    <div id = "search">
    <input type = "text" placeholder = "Search for a book here"></input>
    <button >Search</button>
    </div>
    <About/> 


    </div>
  );
}

export default App;
